export const SetupWizard=()=>{
  const [data,setData]=React.useState([]);
  const getData=()=>{
    fetch('data.json'
    ,{
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
    }
    )
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson);
        setData(myJson)
      });
  }
  React.useEffect(()=>{
    getData()
  },[])
  return(
    <h6>{data}</h6>
  )
}
